                  <Link className="nav-link" to="/seccion2">Secci贸n 2</Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/seccion3">Secci贸n 3</Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/seccion4">Secci贸n 4</Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>

        <Routes>
          <Route path="/seccion1" element={<Section1 />} />
          <Route path="/seccion2" element={<Section2 />} />
          <Route path="/seccion3" element={<Section3 />} />
          <Route path="/seccion4" element={<Section4 />} />
